import Header from './section/header';
import axios from 'axios';

export default function Home() {
  state = {
    setting: {}
  };

  axios.get('http://localhost:5000/').then(res => {console.log(res); setState({setting: res.data}); });
  console.log(state);

  return (
    <>
      <Header setting={state.setting}/>
    </>
  );
}
